import './index.css';
import React from 'react';
import ReactDOM from 'react-dom';

const BookList=()=>{
return(
<session className="booklist">
	<Book/>
	<Book/>
	<Book/>
</session>
)
}
const Book=()=>{
return(
<article className='book'>
	<Title/>
	<Image/>
	<Author/>
</article>
)
}
const Title=()=>{
    return <h3>Man called Ove</h3>
};

const Author=()=>{
    return <h4><i>Fedric backman</i></h4>
};

const Image=()=>{
return <img src="https://www.amazon.com/sljsakoxvfjav" alt="not found" />
}



ReactDOM.render(<BookList/>, document.getElementById('root'));
